import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Footer = () => {
    return (
        <View style={styles.footerContainer}>
            <View>
                <Text>Service</Text>
                </View>
                <Text>Company</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    footerContainer: {
        backgroundColor: "#000",
        padding: '40px',
    }
})

export default Footer;
